
import torch
from torchvision.models import resnet18

from base64toimg import base64_to_image

def load_predict(base64_imgstring):
    # Initialize the model architecture
    model = resnet18(weights=None)
    num_ftrs = model.fc.in_features

    # Recreate the same fc layer structure as in the saved model
    model.fc = torch.nn.Sequential(
        torch.nn.Linear(num_ftrs, 512),
        torch.nn.Dropout(0.2),
        torch.nn.Linear(512, 256),
        torch.nn.Linear(256, 8)  # 8 classes for your shapes
    )

    # Load the saved state dict
    model.load_state_dict(torch.load('resnet18_pretrained-2.pth'))
    model.eval()  # Set the model to evaluation mode

    # Rest of the code remains the same
    device = torch.device("cuda" if torch.cuda.is_available() else "cpu")
    model.to(device)

    # Load and preprocess your image
    from PIL import Image
    import torchvision.transforms as transforms

    base64_to_image(base64_imgstring)
    image_path = "output-test.jpg"
    # image_path = "l.jpg"
    image = Image.open(image_path)

    preprocess = transforms.Compose([
        transforms.Resize(size=(28, 28)),
        transforms.ToTensor(),
    ])

    input_tensor = preprocess(image)
    input_batch = input_tensor.unsqueeze(0).to(device)

    # Make prediction
    with torch.no_grad():
        output = model(input_batch)

    _, predicted_idx = torch.max(output, 1)

    class_names = ['Cube', 'Overlapping-Rectangle', 'circle', 'rhombus',]
    predicted_label = class_names[predicted_idx.item()]
    print(f"The model predicts this shape is a: {predicted_label}")

    return predicted_label


imgstring_base64 = 'data:image/jpeg;base64,'

x = load_predict(imgstring_base64)